CREATE TABLE SOCIOS(
    SocioID INT PRIMARY KEY IDENTITY(1,1),
    Nombre NVARCHAR (100) NOT NULL, 
    Apellido NVARCHAR( 100) NOT NULL,
    FechaNacimiento DATE, 
    Genero CHAR(1) CHECK (Genero IN ('M', 'F', 'O')),
    Email NVARCHAR(100) UNIQUE NOT NULL,
    Telefono NVARCHAR(20),
    FechaRegistro DATE NOT NULL DEFAULT GETDATE(),
    Estado BIT NOT NULL DEFAULT 1
);

CREATE TABLE ENTRENADORES (
    EntrenadoresID INT PRIMARY KEY IDENTITY(1,1),
    Nombre NVARCHAR(100) NOT NULL,
    Apellido NVARCHAR(100) NOT NULL,
    Especialidad NVARCHAR(100),
    Email NVARCHAR(100) UNIQUE NOT NULL,
    Telefono NVARCHAR(20),
    Salario DECIMAL(10,2)

);

CREATE TABLE CLASES (
    ClaseID INT PRIMARY KEY IDENTITY(1,1),
    NombreClase NVARCHAR(100) NOT NULL,
    Descripcion NVARCHAR(500),
    CapacidadMaxima INT NOT NULL,
    DuracionMinutos INT NOT NULL,
    Costo DECIMAL(8,2) NOT NULL
);


CREATE TABLE HORARIOS_CLASE (
    HorarioID INT PRIMARY KEY IDENTITY(1,1),
    ClaseID INT NOT NULL,
    EntrenadorID INT NOT NULL,
    DiaSemana NVARCHAR(15) NOT NULL, 
    HoraInicio TIME NOT NULL,
    HoraFin TIME NOT NULL,
    FOREIGN KEY (ClaseID) REFERENCES CLASES(ClaseID),
    FOREIGN KEY (EntrenadorID) REFERENCES ENTRENADORES(EntrenadoresID)

);

CREATE TABLE RESERVAS (
    ReservaID INT PRIMARY KEY IDENTITY(1,1),
    SocioID INT NOT NULL, 
    HorarioID INT NOT NULL,
    FechaReserva DATE NOT NULL DEFAULT CONVERT(DATE, GETDATE()),
    EstadoReserva NVARCHAR(10) NOT NULL CHECK (EstadoReserva IN ('Confirmada' , 'Cancelada', 'Completada')),
    FOREIGN KEY (SocioID) REFERENCES SOCIOS(SocioID),
    FOREIGN KEY (HorarioID) REFERENCES HORARIOS_CLASE(HorarioID),
    UNIQUE (SocioID, HorarioID, FechaReserva)
);

CREATE TABLE MEMBRESIAS (
    MembresiaID INT PRIMARY KEY IDENTITY(1,1),
    NombreMembresia NVARCHAR(50) UNIQUE NOT NULL,
    CostoMensual DECIMAL(8, 2) NOT NULL,
    DuracionMeses INT NOT NULL,
    Descripcion NVARCHAR(300)
);

CREATE TABLE PAGOS (
    PagoID INT PRIMARY KEY IDENTITY(1,1),
    SocioID INT NOT NULL,
    MembresiaID INT NOT NULL,
    FechaPago DATE NOT NULL DEFAULT GETDATE(),
    MontoPagado DECIMAL(8,2) NOT NULL,
    MetodoPago NVARCHAR(50),
    FechaVencimiento DATE NOT NULL,
    FOREIGN KEY (socioID) REFERENCES SOCIOS(SocioID),
    FOREIGN KEY (MembresiaID) REFERENCES MEMBRESIAS(MembresiaID)
);





























